import React, { useState } from 'react';
import { checkAvailability } from '../api';

export default function AvailabilityForm() {
    const [location, setLocation] = useState('');
    const [vehicleType, setVehicleType] = useState('');
    const [startDateTime, setStartDateTime] = useState('');
    const [durationMins, setDurationMins] = useState('');
    const [availability, setAvailability] = useState(null);
    const [message, setMessage] = useState('');

    const handleCheckAvailability = async () => {
        try {
            const result = await checkAvailability(location, vehicleType, startDateTime, durationMins);
            if (result.vehicleId) {
                setAvailability(result.vehicleId);
                setMessage('Vehicle is available!');
            } else {
                setAvailability(null);
                setMessage(result.message);
            }
        } catch (error) {
            setMessage('Error checking availability.');
        }
    };

    return (
        <div>
            <h2>Check Vehicle Availability</h2>
            <div>
                <label>Location:</label>
                <input type="text" value={location} onChange={(e) => setLocation(e.target.value)} />
            </div>
            <div>
                <label>Vehicle Type:</label>
                <input type="text" value={vehicleType} onChange={(e) => setVehicleType(e.target.value)} />
            </div>
            <div>
                <label>Start Date and Time:</label>
                <input type="datetime-local" value={startDateTime} onChange={(e) => setStartDateTime(e.target.value)} />
            </div>
            <div>
                <label>Duration (minutes):</label>
                <input type="number" value={durationMins} onChange={(e) => setDurationMins(e.target.value)} />
            </div>
            <button onClick={handleCheckAvailability}>Check Availability</button>
            {message && <p>{message}</p>}
            {availability && <p>Vehicle ID: {availability}</p>}
        </div>
    );
}
